import React, {useState} from 'react'
import PropTypes from 'prop-types'

export default function TextForms(props) {
    const [text,newText] = useState("Enter your Text Here..");
  return (
    <div className="container">
        <h3>{props.heading}</h3>
<div className="mb-3">
  <label htmlFor="exampleFormControlTextarea1" className="form-label">Example textarea</label>
  <textarea className="form-control" id="exampleFormControlTextarea1" rows="8" value={text}></textarea>
</div>
<button type="button" className="btn btn-primary">Change Case to UpperCase</button>
    </div>

  )
}

